// src/pages/Clients.js
export default function Clients() {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold">Clients</h1>
      <p className="text-gray-600 mt-2">Here you can manage all client information.</p>
    </div>
  );
}
